import React from 'react';

const Employee = ({employee}) => {
  return (
            <tr key={employee.id} class="border-slate-200 shadow">
            <td class="font-extralight">{employee.id}</td>
            <td class="font-extralight">{employee.name}</td>
            <td class="font-extralight">{employee.designation}</td>
            <td class="font-extralight">{employee.salary}</td>
          </tr>
  );
}

export default Employee;
